import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import ScreeningInfoComponent from './ScreeningInfoComponent';
import GuestPage from './GuestPage';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<LandingPage />} />
                <Route path="/guest" element={<GuestPage />} />
                <Route path="/login" element={<LoginPage />} />
            </Routes>
        </Router>
    );
}

function LandingPage() {
    const navigate = useNavigate();

    return (
        <div className="App">
            <header className="App-header">
                <h1>Welcome to HRK's Cinema</h1>
            </header>
            <main className="landing-page">
                <div className="login-options">
                    <h2> Login </h2>
                    <div className="login-option">
                        <button className="guest-login" onClick={() => navigate('/login')}> Login using Google </button>
                        <p className="description"> This will allow you to access your booking history and
                            preferences. </p>
                    </div>
                    <div className="login-option">
                        <button className="guest-login" onClick={() => navigate('/guest')}> Continue as guest </button>
                        <p className="description"> No login required. </p>
                    </div>
                </div>
                <ScreeningInfoComponent/>
            </main>
        </div>
    );
}

export default App;
